import "./BingoIntroPage.css";

function BingoIntroPage() {
  const myName = "Kat";
  const myMbti = "INFP";

  return (
    <>
      <h1>
        <span className="myID">
          {myMbti} {myName}
        </span>
        님의 진짜 MBTI는?!
      </h1>
    </>
  );
}

export default BingoIntroPage;
